def _generate_tests(self, request, code: str) -> str:
        """Generate Go tests with testify"""
        return f'''
// Go Tests for {request.message}
package main

import (
    "context"
    "testing"
    "time"

    "github.com/stretchr/testify/assert"
    "github.com/stretchr/testify/require"
    "github.com/stretchr/testify/suite"
)

// Test suite
type TestSuite struct {{
    suite.Suite
    service *AliceService
    config  *Config
}}

func (suite *TestSuite) SetupTest() {{
    suite.config = &Config{{
        ServiceName: "test-service",
        Port:        8080,
        LogLevel:    "info", 
        Timeout:     30,
    }}

    suite.service = NewAliceService(suite.config)
    err := suite.service.Initialize()
    require.NoError(suite.T(), err)
}}

func (suite *TestSuite) TestHealthCheck() {{
    health := suite.service.HealthCheck()

    assert.NotNil(suite.T(), health)
    assert.Equal(suite.T(), "UP", health.Status)
    assert.NotZero(suite.T(), health.Timestamp)
    assert.Contains(suite.T(), health.Details, "service")
}}

func TestAliceTestSuite(t *testing.T) {{
    suite.Run(t, new(TestSuite))
}}
'''
